A GObject (or glib::Object in Rust terms) is a reference-counted, mutable object. It therefore behaves very similar to Rc<RefCell<T>>. Let us see in a set of real life examples which consequences this has. use gtk::prelude::*;
use gtk::{self, Application, ApplicationWindow, Button, Orientation}; fn main() { // Create a new application let app = Application::new(Some("org.gtk.example"), Default::default()); app.connect_activate(on_activate); // Run the application app.run();
} // When the application is launched…
fn on_activate(application: &Application) { // … create a new window … let window = ApplicationWindow::new(application); // Create two buttons let button_increase = Button::with_label("Increase"); let button_decrease = Button::with_label("Decrease"); // A mutable integer let mut number = 0; // Connect callbacks // When a button is clicked, `number` should be changed button_increase.connect_clicked(|_| number += 1); button_decrease.connect_clicked(|_| number -= 1); // Add buttons let gtk_box = gtk::Box::new(Orientation::Vertical, 0); window.set_child(Some(&gtk_box)); gtk_box.append(&button_increase); gtk_box.append(&button_decrease); window.present();
} Here we would like to create a simple app with two buttons. If we click on one button, an integer number should be increased. If we press the other one, it should be decreased. The Rust compiler refuses to compile it though. For once the borrow checker kicked in: error[E0499]: cannot borrow `number` as mutable more than once at a time --> main.rs:27:37 |
26 | button_increase.connect_clicked(|_| number += 1); | ------------------------------------------------ | | | | | | | first borrow occurs due to use of `number` in closure | | first mutable borrow occurs here | argument requires that `number` is borrowed for `'static`
27 | button_decrease.connect_clicked(|_| number -= 1); | ^^^ ------ second borrow occurs due to use of `number` in closure | | | second mutable borrow occurs here Also, the compiler tells us that our closures may outlive number: error[E0373]: closure may outlive the current function, but it borrows `number`, which is owned by the current function --> main.rs:26:37 |
26 | button_increase.connect_clicked(|_| number += 1); | ^^^ ------ `number` is borrowed here | | | may outlive borrowed value `number` |
note: function requires argument type to outlive `'static` --> main.rs:26:5 |
26 | button_increase.connect_clicked(|_| number += 1); | ^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^
help: to force the closure to take ownership of `number` (and any other referenced variables), use the `move` keyword |
26 | button_increase.connect_clicked(move |_| number += 1); | ^^^^^^^^ Thinking about the second error message, it makes sense that the closure requires the lifetimes of references to be 'static. The compiler cannot know when the user presses a button, so references must live forever. And our number gets immediately deallocated after it reaches the end of its scope. The error message is also suggesting that we could take ownership of number. But is there actually a way that both closures could take ownership of the same value? Yes! That is exactly what the Rc type is there for. The Rc counts the number of strong references created via Clone::clone and released via Drop::drop, and only deallocates it when this number drops to zero. We call every object containing a strong reference a shared owner of the value. If we want to modify the content of our Rc , we can use the RefCell type. RefCell then checks Rust's borrow rules during run time, namely that there can only be one mutable borrow at a time or multiple immutable borrows. RefCell panics if these rules are violated. Filename: listings/gobject_memory_management/1/main.rs # use gtk::prelude::*;
