GObjects rely heavily on inheritance. Therefore, it makes sense that if we want to create a custom GObject, this is done via subclassing. Let us see how this works by replacing the button in our "Hello World!" app with a custom one. First, we need to create an implementation struct that holds the state and overrides the virtual methods. It is advised to keep it in a private module, since its state and methods are only meant to be used by the GObject itself. It therefore corresponds to the private section of objects in languages like Java and C++. Filename: listings/gobject_subclassing/1/custom_button/imp.rs use gtk::glib;
use gtk::subclass::prelude::*; // Object holding the state
#[derive(Default)]
pub struct CustomButton; // The central trait for subclassing a GObject
#[glib::object_subclass]
impl ObjectSubclass for CustomButton { const NAME: &'static str = "MyGtkAppCustomButton"; type Type = super::CustomButton; type ParentType = gtk::Button;
} // Trait shared by all GObjects
impl ObjectImpl for CustomButton {} // Trait shared by all widgets
impl WidgetImpl for CustomButton {} // Trait shared by all buttons
impl ButtonImpl for CustomButton {} The description of the subclassing is in ObjectSubclass. NAME should consist of crate-name, module-path and object-name in order to avoid name collisions. Use PascalCase here. Type refers to the actual GObject that will be created afterwards. ParentType is the GObject we inherit of. After that, we would have the option to override the virtual methods of our ancestors. Since we only want to have a plain button for now, we override nothing. We still have to add the empty impl though. Next, we describe our custom GObject. Filename: listings/gobject_subclassing/1/custom_button/mod.rs mod imp; use gtk::glib; glib::wrapper! { pub struct CustomButton(ObjectSubclass<imp::CustomButton>) @extends gtk::Button, gtk::Widget;
} impl CustomButton { pub fn new() -> Self { glib::Object::new(&[]).expect("Failed to create Button") } pub fn with_label(label: &str) -> Self { glib::Object::new(&[("label", &label)]).expect("Failed to create Button") }
} impl Default for CustomButton { fn default() -> Self { CustomButton::new() }
} glib::wrapper! does the most of the work of subclassing for us. We only have to point to the implementation struct and which ancestor GObjects we extend. Please note that the list of ancestor GObjects does not mention glib::Object. This is because glib::Object is always the base class in the object hierarchy and therefore already implied. After these steps, nothing is stopping us anymore from replacing gtk::Button with our CustomButton. Filename: listings/gobject_subclassing/1/main.rs mod custom_button; use custom_button::CustomButton;
use gtk::prelude::*;
use gtk::{Application, ApplicationWindowBuilder}; fn main() { // Create a new application let app = Application::new(Some("org.gtk.example"), Default::default()); app.connect_activate(on_activate); // Run the application app.run();
} // When the application is launched…
fn on_activate(application: &Application) { // … create a new window … let window = ApplicationWindowBuilder::new() .application(application) .title("My GTK App") .build(); // Create a button let button = CustomButton::with_label("Press me!"); button.set_margin_top(12); button.set_margin_bottom(12); button.set_margin_start(12); button.set_margin_end(12); // Connect callback button.connect_clicked(move |button| { // Set the label to "Hello World!" after the button has been clicked on button.set_label("Hello World!"); }); // Add button window.set_child(Some(&button)); window.present();
} We are able to use CustomButton as a drop-in replacement for gtk::Button. This is cool, but also not very tempting to do in a real application. For the gain of zero benefits, it did involve quite a bit of boilerplate after all. So let us make it a bit more interesting! gtk::Button does not hold much state, but we can let CustomButton hold a number. Filename: listings/gobject_subclassing/2/custom_button/imp.rs use gtk::glib;
use gtk::prelude::*;
use gtk::subclass::prelude::*;
use std::cell::RefCell; // Object holding the state
#[derive(Default)]
pub struct CustomButton { number: RefCell<i32>,
} // The central trait for subclassing a GObject
#[glib::object_subclass]
impl ObjectSubclass for CustomButton { const NAME: &'static str = "MyGtkAppCustomButton"; type Type = super::CustomButton; type ParentType = gtk::Button;
} // Trait shared by all GObjects
impl ObjectImpl for CustomButton { fn constructed(&self, obj: &Self::Type) { self.parent_constructed(obj); obj.set_label(&self.number.borrow().to_string()); }
} // Trait shared by all widgets
impl WidgetImpl for CustomButton {} // Trait shared by all buttons
impl ButtonImpl for CustomButton { fn clicked(&self, button: &Self::Type) { *self.number.borrow_mut() += 1; button.set_label(&self.number.borrow().to_string()) }
} We override constructed in ObjectImpl so that the label of the button initializes with number. We also override clicked in ButtonImpl so that every click increases number and updates the label. Filename: listings/gobject_subclassing/2/main.rs # mod custom_button;
# # use custom_button::CustomButton;
# use gtk::prelude::*;
# use gtk::{Application, ApplicationWindowBuilder};
# # fn main() {
# // Create a new application
# let app = Application::new(Some("org.gtk.example"), Default::default());
# app.connect_activate(on_activate);
# # // Run the application
# app.run();
# }
// When the application is launched…
fn on_activate(application: &Application) { // … create a new window … let window = ApplicationWindowBuilder::new() .application(application) .title("My GTK App") .build(); // Create a button let button = CustomButton::new(); button.set_margin_top(12); button.set_margin_bottom(12); button.set_margin_start(12); button.set_margin_end(12); // Add button window.set_child(Some(&button)); window.present();
} In on_activate we stop calling connect_clicked, and that was it. After a rebuild, the app now features our CustomButton with the label "0". Every time we click on the button, the number displayed by the label increases by 1. So, when do we want to inherit from GObject? We want to use a certain widget, but with added state and overridden virtual functions. We want to pass a Rust object to a function, but the function expects a GObject. We want to add properties or signals to an object.

