Some GObject-related functions rely on generic values for their arguments or return parameters. Enums in C are not as powerful as the one in Rust, which is why glib::Value is used for this. Conceptually though, there are similar to a Rust enum defined like this: enum Value <T> { bool(bool), i8(i8), i32(i32), u32(u32), i64(i64), u64(u64), f32(f32), f64(f64), // boxed types String(Option<String>), Object(Option<T: impl IsA<Object>>),
} That means that a glib::Value can represent a set of types, but only one of them per instance. Also note that boxed types such as String or Object are wrapped in an Option. This comes from C, where boxed types can always be None (or null in C terms). That also means that the retrieval of Rust types from glib::Value differs slightly between boxed and non-boxed types. use gtk::prelude::*; fn main() { let number_value = 10.to_value(); let string_value = "Hello!".to_value(); // Retrieve `i32` from `number_value` let number = number_value .get_some::<i32>() .expect("The value needs to be of type `i32`."); assert_eq!(number, 10); // Retrieve `String` from `string_value` let string = string_value .get::<String>() .expect("The value needs to be of type `String`.") .expect("The value needs to be `Some`."); assert_eq!(string, "Hello!");
} For now, all you need to know is how to convert a Rust type into a glib::Value and vice versa. This knowledge will be useful in the next chapters where we discuss properties, signals and models.

