Properties provide a public API for accessing state of GObjects. Let us see how this is done by experimenting with the Switch widget. One of its properties is the state . According to the GTK docs, it can be read and be written to. That is why, gtk-rs provides corresponding get_state and set_state methods. Filename: listings/gobject_properties/1/main.rs # use gtk::prelude::*;
# use gtk::{Align, BoxBuilder, Orientation, Switch};
# use gtk::{Application, ApplicationWindowBuilder};
