We now got comfortable using callbacks, but how do they actually work? All of this happens asynchronously, so there must be something managing the events and scheduling the responses. Unsurprisingly, this is called the main event loop. The main loop manages all kinds of events — from mouse clicks and keyboard presses to file events. It does all of that within the same thread. Quickly iterating between all tasks gives the illusion of parallelism. That is why you can move the window at the same time as a progress bar is growing. However, you surely saw GUIs that became unresponsive, at least for a few seconds. That happens when a single task takes too long. Let us look at one example. Filename: listings/main_event_loop/1/main.rs use std::time::Duration; use gtk::prelude::*;
