We have now learned multiple ways to handle states. However, every time we close the application all of it is gone. Let us learn how to use GSettings by storing the state of a Switch in it. At the very beginning we have to create a GSchema xml file in order to describe the kind of data our application plans to store in the settings. Filename: listings/settings/1/org.gtk.example.gschema.xml <?xml version="1.0" encoding="utf-8"?>
<schemalist> <schema id="org.gtk.example" path="/org/gtk/example/"> <key name="is-switch-enabled" type="b"> <default>false</default> <summary>Default switch state</summary> </key> </schema>
</schemalist> Let us get through it step by step. The id is the same application id we used when we created our application. Filename: listings/settings/1/main.rs # use gio::Settings;
