# let settings = Settings::new("org.gtk.example");
# # // Get the last switch state from the settings
# let is_switch_enabled = settings.get_boolean("is-switch-enabled");
# # // Create a switch
# let switch = SwitchBuilder::new()
# .margin_top(48)
# .margin_bottom(48)
# .margin_start(48)
