Now that we have got a working installation, let us get right into it! At the very least, we need to create an Application instance, with an application id and the default application flags. This guide helps you find a suitable application id for your app. Filename: listings/hello_world/1/main.rs use gtk::prelude::*;
use gtk::Application; fn main() { // Create a new application let app = Application::new(Some("org.gtk.example"), Default::default()); // Run the application app.run();
} It builds fine, but nothing appears on our screen. GTK warns us, that it would have expected that something would be called in its activate step. So let us create a window there. Filename: listings/hello_world/2/main.rs use gtk::prelude::*;
use gtk::{Application, ApplicationWindow}; fn main() { // Create a new application let app = Application::new(Some("org.gtk.example"), Default::default()); app.connect_activate(on_activate); // Run the application app.run();
} // When the application is launched…
fn on_activate(application: &Application) { // … create a new window … let window = ApplicationWindow::new(application); // Set the window title window.set_title(Some("My GTK App")); window.present();
} That is better! Normally we expect to be able to interact with the user interface. Also, the name of the chapter suggests that the phrase "Hello World!" will be involved. Filename: listings/hello_world/3/main.rs # use gtk::prelude::*;
# use gtk::{Application, ApplicationWindow, Button};
# # fn main() {
# // Create a new application
# let app = Application::new(Some("org.gtk.example"), Default::default());
# app.connect_activate(on_activate);
# # // Run the application
# app.run();
# }
# // When the application is launched…
fn on_activate(application: &Application) { // … create a new window … let window = ApplicationWindow::new(application); // Set the window title window.set_title(Some("My GTK App")); // Create a button let button = Button::with_label("Press me!"); // Set the button margins button.set_margin_top(12); button.set_margin_bottom(12); button.set_margin_start(12); button.set_margin_end(12); // Connect callback button.connect_clicked(move |button| { // Set the label to "Hello World!" after the button has been clicked on button.set_label("Hello World!"); }); // Add button window.set_child(Some(&button)); window.present();
} There is now a button and if we click on it, its label becomes "Hello World!". Was not that hard to create our first gtk-rs app, right? Let us now get a better understanding of what we did here.

